Let's analyze the evidence and testimonies provided.

Testimony 5 states that Wellington saw "the banana that fell with the police officer." However, Evidence 6 objects to this: it specifies that the baseball glove "was made to be worn on the right hand" and "looks kind of like a banana." If Wellington saw something "banana-like," it must have been the glove. But since he is able to describe its banana-like appearance, but later claims not to know anything about the real evidence (the glove), this suggests the testimony is suspicious and contradicts the nature of the evidence, indicating he must have been involved closely enough to see and describe the glove. This contradiction points out that Wellington's testimony is questionable regarding his awareness of the incident.

